        {
            if (int.TryParse(args.Value?.ToString(), out int taxYear))
            {
                TaxYear = taxYear;
            }
        }
        private void HandleFilingStatusChange(ChangeEventArgs args)
        {

            if (int.TryParse(args.Value?.ToString(), out int filingstatus))
            {
                FilingStatus = filingstatus;
